import React, { Component } from 'react';
import axios from 'axios';
import listItem from './ListItem';

class SideBar extends Component {

  componentDidMount() {
    let links = axios.get("../res/sideBarLinks");
    console.log(links);
  }

  render(){
    return(
      <p>{this.props.text}</p>
    );
  }
}

export default SideBar;
